import MainClick from "./MainScooter";

function Boss({ handleClicks, bossCount, HP, defense, number }) {
  const handleClick = () => {
    const result = handleClicks(); // Вызываем функцию handleClicks
    return result;
  };

  return (
    <div className="main_click">
      <MainClick handleClick={handleClick} number={number} bossCount={bossCount} />
      <span className="main_count">HP: {HP} Защита: {defense}</span>
    </div>
  );
}

export default Boss;
